//--------------------------------------------------------- char TrackbarName[50]; void deslocaDFT(Mat& image ){ Mat tmp, A, B, C, D; // se a imagem tiver tamanho impar, recorta a regiao para // evitar cÃģpias de tamanho desigual image = image(Rect(0, 0, image.cols & -2, image.rows & -2)); int cx = image.cols/2; int cy = image.rows/2; // reorganize quadrants // A B -> D C // C D B A A = image(Rect(0, 0, cx, cy)); B = image(Rect(cx, 0, cx, cy)); C = image(Rect(0, cy, cx, cy)); D = image(Rect(cx, cy, cx, cy)); // A <-> D A.copyTo(tmp); D.copyTo(A); tmp.copyTo(D); // C <-> B C.copyTo(tmp); B.copyTo(C); tmp.copyTo(B);
