} void on_trackbar_yh(int, void*) { yh = yh_slider*yhmax/MAX; filtroHM();
}
void on_trackbar_c(int, void*) { c = c_slider*cmax / MAX; filtroHM();
} int main(int argvc , char** argv){ //open image if (argvc != 2) { cerr << "Usage: " << argv[0] << " <img_path>" << endl; return 1; } filename = argv[1]; image = imread(filename); cvtColor(image, image, CV_BGR2GRAY); // Identify the optimum size for // Calculating FFT dft_M = getOptimalDFTSize(image.rows); dft_N = getOptimalDFTSize(image.cols); // Image padding Mat_<float> zeros; copyMakeBorder(image, padded, 0, dft_M - image.rows, 0, dft_N - image.cols, BORDER_CONSTANT, Scalar::all(0)); // Zero padding - complex part of the matrix zeros = Mat_<float>::zeros(padded.size()); // prepare the complex part imageDft = Mat(padded.size(), CV_32FC2, Scalar(0)); copyMakeBorder(image, padded, 0, dft_M - image.rows, 0, dft_N - image.cols, BORDER_CONSTANT, Scalar::all(0)); Mat_<float> realInput = Mat_<float>(padded); // insere the two components within the matrices arrays vector<Mat> planos; planos.push_back(realInput); planos.push_back(zeros); // combine matrices array into a single // complex component merge(planos, imageDft); // calcula o dft dft(imageDft, imageDft); deslocaDFT(imageDft); namedWindow("Homomorfic filter", WINDOW_NORMAL); sprintf( TrackbarName, "Yh"); createTrackbar( TrackbarName, "Filtro Homomorfico", &yh_slider, MAX, on_trackbar_yh); sprintf( TrackbarName, "YL"); createTrackbar( TrackbarName, "Filtro Homomorfico", &yl_slider, MAX, on_trackbar_yl); sprintf( TrackbarName, "D0"); createTrackbar( TrackbarName, "Filtro Homomorfico", &d0_slider, MAX, on_trackbar_d0 ); sprintf(TrackbarName, "C"); createTrackbar( TrackbarName, "Filtro Homomorfico", &c_slider, MAX, on_trackbar_c); filtroHM(); waitKey(0); return 0;
